import styled from 'styled-components'

export const Container = styled.div`
	margin-top: 20px;

	li {
		display: flex;
		justify-content: space-between;
		align-items: center;
		color: #444;

		& + li {
			margin-top: 15px;
		}
	}
`

export const FileInfo = styled.div`
	display: flex;
	align-items: center;

	div {
		display: flex;
        flex-direction: column;

        span {
            font-size: 12px
            color: #999
        }
	}
`

export const Preview = styled.div``
